import React from 'react'
import axios from 'axios'
import { useEffect } from 'react'

const DashboardView = () => {
    useEffect(() => {
        const fetchDrugInfo = async () => {
            const options = {
                method: 'GET',
                url: 'https://drug-info-and-price-history.p.rapidapi.com/1/druginfo',
                params: { drug: 'advil' },
                headers: {
                    'X-RapidAPI-Key': 'c8a8e86c4bmshaf6ec9cd4fafff7p1bc63ejsn8b52e0af2dde',
                    'X-RapidAPI-Host': 'drug-info-and-price-history.p.rapidapi.com'
                }
            };

            try {
                const response = await axios.request(options);
                console.log(response.data);
                // Do something with the response data, e.g., update the state to show the data in your UI.
            } catch (error) {
                console.error(error);
            }
        };

        fetchDrugInfo();
    }, []);

    return (
        <div>
            <h1>My Drug App</h1>
            {/* Add your UI components here to display the drug information */}
        </div>
    );
}

export default DashboardView
